import React from "react";
import Footer from "./Footer";
import Header from "./Header";
import Note from "./Note";
import notes from "../notes";

function App() {
    return [<Header />, <Footer />,
    <div>
    {notes.map((newNote) => (
        <Note
        key={newNote.key}
        title={newNote.title}
        content={newNote.content}
        />
    ))}
    </div>
];
}

export default App;
